import React, { Component } from 'react';
import './Card.css';

class Card extends Component {
  render() {
    return (
      <div>
        { this.props.orders.map((order) => {
          return (
            <div>{order.line_items.name}</div>
          )
        })}
      </div>
    )
}
}

export default Card;
